var title_f27_31_28144="Shoulder strength exercises";
var content_f27_31_28144=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F59996&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F59996&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Strengthening exercises for the rotator cuff tendons",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 233px; height: 492px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Part A: The inward rotation isometric exercise is performed by holding the elbow at 90&deg;, close to the side. The rubber band is hooked onto a door handle and grasped with the hand. The forearm is slowly moved towards the body two to three inches, and held for five seconds. The hand should not rotate as the forearm moves.",
"    <br>",
"     Part B: The outward rotation isometric exercise is performed with the elbows at 90&deg;, close to the sides. The rubber band is grasped with the hands. The formearms are moved outward two to three inches and held for five seconds. Sets of 15 to 20 exercises, each held for five seconds, should be performed daily.",
"     <div class=\"footnotes\">",
"     </div>",
"     <div class=\"reference\">",
"      Courtesy of Bruce C Anderson, MD.",
"     </div>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
