"    Lichen planus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 324px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Violaceous polygonal papules are present on the ventral wrists.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: www.visualdx.com. Copyright Logical Images, Inc.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lichen planus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 361px; height: 283px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Note discrete polygonal scaling erythematous papules on the wrist.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Beth G Goldstein, MD and Adam O Goldstein, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Lichen planus",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 432px; height: 286px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Lichen planus. Flat-topped, violaceous, polygonal papules on the flexor wrists are present. There are active and resolving lesions. Note the postinflammatory hyperpigmentation.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Goodheart, HP. Goodheart's Photoguide of Common Skin Disorders, 2nd ed, Lippincott Williams &amp; Wilkins, Philadelphia 2003. Copyright &copy; 2003 Lippincott Williams &amp; Wilkins.",
