var outline_f27_31_28158=null;
var title_f27_31_28159="AGAI management GERD 1";
var content_f27_31_28159=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=GAST%2F51891%7EGAST%2F64967%7EGAST%2F76758&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=21\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=GAST%2F51891%7EGAST%2F64967%7EGAST%2F76758&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=21\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    AGAI management GERD",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What is the efficacy of lifestyle modifications for GERD? Which elements should be recommended and in which circumstances?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade B: recommended with fair evidence that it improves important outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Weight loss should be advised for overweight or obese patients with esophageal GERD syndromes.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. Elevation of the head of the bed for selected patients who are troubled with heartburn or regurgitation when recumbent. Other lifestyle modifications including, but not limited to, avoiding late meals, avoiding specific foods, or avoiding specific activities should be tailored to the circumstances of the individual patient.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade Insuff: no recommendation, insufficient evidence to recommend for or against",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Broadly advocating lifestyle changes for all (as opposed to selected) patients with GERD.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        How do antisecretory therapies compare in efficacy and under what circumstances might one be preferable to another? What is an acceptable upper limit of empirical therapy in patients with suspected typical esophageal GERD syndromes before performing esophagogastroduodenoscopy?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade A: strongly recommended based on good evidence that it improves important health outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Antisecretory drugs for the treatment of patients with esophageal GERD syndromes (healing esophagitis, and symptomatic relief). In these uses, proton pump inhibitors (PPIs) are more effective than histamine2 receptor antagonists (H2RAs), which are more effective than placebo.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade B: recommended with fair evidence that it improves important outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Twice-daily PPI therapy for patients with an esophageal syndrome with an inadequate symptom response to once-daily PPI therapy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. A short course or as-needed use of antisecretory drugs in patients with a symptomatic esophageal syndrome without esophagitis when symptom control is the primary objective. For a short course of therapy, PPIs are more effective than H2RAs, which are more effective than placebo.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade D: recommend against, fair evidence that it is ineffective or harms outweigh benefits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Metoclopramide as monotherapy or adjunctive therapy in patients with esophageal or suspected extraesophageal GERD syndromes.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Kahrilas PJ, Shaheen NJ, Vaezi M. American Gastroenterological Association Medical Position Statement on the Management of Gastroesophageal Reflux Disease. Gastroenterology 2008; 135:1383.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    AGAI management GERD (continued)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What is the role and priority of diagnostic tests (endoscopy with or without biopsy, esophageal manometry, ambulatory pH monitoring, impedance-pH monitoring) in the evaluation of patients with suspected esophageal GERD syndromes?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade B: recommended with fair evidence that it improves important outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Endoscopy with biopsy for patients with an esophageal GERD syndrome with troublesome dysphagia. Biopsies should target any areas of suspected metaplasia, dysplasia, or in the absence of visual abnormalities, normal mucosa (at least 5 samples to evaluate for eosinophilic esophagitis).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. Endoscopy to evaluate patients with a suspected esophageal GERD syndrome who have not responded to an empirical trial of twice-daily PPI therapy. Biopsies should target any area of suspected metaplasia, dysplasia, or malignancy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        III. Manometry to evaluate patients with a suspected esophageal GERD syndrome who have not responded to an empirical trial of twice-daily PPI therapy and have normal findings on endoscopy. Manometry will serve to localize the LES for potential subsequent pH monitoring, to evaluate peristaltic function preoperatively, and to diagnose subtle presentations of the major motor disorders. Evolving information suggests that high-resolution manometry has superior sensitivity to conventional manometry in recognizing atypical cases of achalasia and distal esophageal spasm.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        IV. Ambulatory impedance-pH, catheter pH, or wireless pH monitoring (PPI therapy withheld for 7 days) to evaluate patients with a suspected esophageal GERD syndrome who have not responded to an empirical trial of PPI therapy, have normal findings on endoscopy, and have no major abnormality on manometry. Wireless pH monitoring has superior sensitivity to catheter studies for detecting pathological esophageal acid exposure because of the extended period of recording (48 hours) and has also shown superior recording accuracy compared with some catheter designs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade Insuff: no recommendation, insufficient evidence to recommend for or against",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Using alarm symptoms (other than troublesome dysphagia) as a screening tool to identify patients with GERD at risk for esophageal adenocarcinoma.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. Combined impedance-pH, catheter pH, or wireless pH monitoring studies to distinguish hypersensitivity syndromes from functional syndromes, the distinction being that in hypersensitivity syndromes symptoms are attributable to reflux events, whereas in functional syndromes they are not.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        III. Combined impedance-pH, catheter pH, or wireless pH esophageal monitoring studies performed while taking PPIs.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What are the unique management considerations in patients with suspected reflux chest pain syndrome?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade A: strongly recommended based on good evidence that it improves important health outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Twice-daily PPI therapy as an empirical trial for patients with suspected reflux chest pain syndrome after a cardiac etiology has been carefully considered.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What is the best initial management for patients with suspected extraesophageal reflux syndromes (asthma, laryngitis, cough)? What are the unique management considerations with each? What is the appropriate dose and course of antisecretory therapy in each?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade B: recommended with fair evidence that it improves important outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Acute or maintenance therapy with once- or twice-daily PPIs (or H2RAs) for patients with a suspected extraesophageal GERD syndrome (laryngitis, asthma) with a concomitant esophageal GERD syndrome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade D: recommend against, fair evidence that it is ineffective or harms outweigh benefits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Once- or twice-daily PPIs (or H2RAs) for acute treatment of patients with potential extraesophageal GERD syndromes (laryngitis, asthma) in the absence of a concomitant esophageal GERD syndrome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade Insuff: no recommendation, insufficient evidence to recommend for or against",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Once- or twice-daily PPIs for patients with suspected reflux cough syndrome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Does GERD progress in severity, such that symptomatic patients without esophagitis develop esophagitis and Barrett's metaplasia, or are these distinct disease manifestations that do not exist along a continuum? If patients do progress, at what rate does this occur, and does it warrant endoscopic monitoring?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade D: recommend against, fair evidence that it is ineffective or harms outweigh benefits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Routine endoscopy in subjects with erosive or nonerosive reflux disease to assess for disease progression.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What maintenance therapy is indicated for patients with the typical esophageal reflux syndrome (with or without esophagitis)? When and how should antisecretory therapy be decreased or discontinued? What, if any, risks are associated with this?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade A: strongly recommended based on good evidence that it improves important health outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Long-term use of PPIs for the treatment of patients with esophagitis once they have proven clinically effective. Long-term therapy should be titrated down to the lowest effective dose based on symptom control.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade D: recommend against, fair evidence that it is ineffective or harms outweigh benefits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Less than daily dosing of PPI therapy as maintenance therapy in patients with an esophageal syndrome who previously had erosive esophagitis.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Kahrilas PJ, Shaheen NJ, Vaezi M. American Gastroenterological Association Medical Position Statement on the Management of Gastroesophageal Reflux Disease. Gastroenterology 2008; 135:1383.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    AGAI management GERD (continued)",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What maintenance therapy is indicated for patients with suspected extraesophageal reflux syndromes (asthma, laryngitis, cough)? When and how should antisecretory therapy be decreased or discontinued?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade B: recommended with fair evidence that it improves important outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Acute or maintenance therapy with once- or twice-daily PPIs (or H2RAs) for patients with a suspected extraesophageal GERD syndrome (laryngitis, asthma) with a concomitant esophageal GERD syndrome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade Insuff: no recommendation, insufficient evidence to recommend for or against",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Maintenance therapy with once- or twice-daily PPIs (or H2RAs) for patients with potential extraesophageal GERD syndromes (laryngitis, asthma) in the absence of a concomitant esophageal GERD syndrome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. Once- or twice-daily PPIs for patients with suspected reflux cough syndrome.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What are the clinical consequences of chronic potent acid inhibition? Do these potential side effects warrant specific testing (eg, bone density studies, calcium supplementation, Helicobacter pylori screening, and so on)?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade Insuff: no recommendation, insufficient evidence to recommend for or against",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Advocating bone density studies, calcium supplementation, Helicobacter pylori screening, or any other routine precaution because of PPI use.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What is the role of endoscopy in long-term management of patients with GERD, and under what circumstances should mucosal biopsy specimens be obtained when endoscopy is performed?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade B: recommended with fair evidence that it improves important outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Endoscopy with biopsy for patients with an esophageal GERD syndrome with troublesome dysphagia. Biopsies should target any areas of suspected metaplasia, dysplasia, or in the absence of any visual abnormalities, normal mucosa (at least 5 samples to evaluate for eosinophilic esophagitis).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade Insuff: no recommendation, insufficient evidence to recommend for or against",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Routine upper endoscopy in the setting of chronic GERD symptoms to diminish the risk of death from esophageal cancer.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. Endoscopic screening for Barrett's esophagus and dysplasia in adults 50 years or older with &gt;5-10 years of heartburn to reduce mortality from esophageal adenocarcinoma.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        What are indications for antireflux surgery, and what is the efficacy of this therapy?",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade A: strongly recommended based on good evidence that it improves important health outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. When antireflux surgery and PPI therapy are judged to offer similar efficacy in a patient with an esophageal GERD syndrome, PPI therapy should be recommended as initial therapy because of superior safety.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. When a patient with an esophageal GERD syndrome is responsive to, but intolerant of, acid suppressive therapy, antireflux surgery should be recommended as an alternative.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade B: recommended with fair evidence that it improves important outcomes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Antireflux surgery for patients with an esophageal GERD syndrome with persistent troublesome symptoms, especially troublesome regurgitation, despite PPI therapy. The potential benefits of antireflux surgery should be weighed against the deleterious effect of new symptoms consequent from surgery, particularly dysphagia, flatulence, an inability to belch, and postsurgery bowel symptoms.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade C: balance of benefits and harms is too close to justify a general recommendation",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Patients with an extraesophageal GERD syndrome with persistent troublesome symptoms despite PPI therapy should be considered for antireflux surgery. The potential benefits of antireflux surgery should be weighed against the deleterious effect of new symptoms consequent from surgery, particularly dysphagia, flatulence, an inability to belch, and postsurgery bowel symptoms.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade D: recommend against, fair evidence that it is ineffective or harms outweigh benefits",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. Antireflux surgery for patients with an esophageal syndrome with or without tissue damage who are symptomatically well controlled on medical therapy.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        II. Antireflux surgery as an antineoplastic measure in patients with Barrett's metaplasia.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Grade Insuff: no recommendation, insufficient evidence to recommend for or against",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent2\">",
"        I. The use of currently commercially available endoluminal antireflux procedures in the management of patients with an esophageal syndrome.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Kahrilas PJ, Shaheen NJ, Vaezi M. American Gastroenterological Association Medical Position Statement on the Management of Gastroesophageal Reflux Disease. Gastroenterology 2008; 135:1383.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
